Electrifying Paris. With two ULTRA special people. 
@dqsalmaan - for those who don’t know, is actually the first backer/supporter/investor in Ultraviolette and what a journey it’s been. From trying to sync time to ride the F77s to finally riding around Paris - truly unforgettable. DQ, like you said, you’ve been part of this from the first sketch on paper to now going global. Cheers to the start of many milestones to celebrate together. 
@rannvijaysingha - from connecting in 2021 to meeting a few months later to brainstorming crazy ideas and formally coming on board as an investor in 2022, the journey since has been tremendously exciting. Like @priankasingha says, his brain is a storm.. and rightly so. 
What do we all share in common? That passion for Design, Tech, performance automobiles and that penchant to take on the impossible.
I’m so glad that you were here with us for this moment in history. And yet, the race has just begun. 

@nirajrajmohan you were officially missed by all of us. 
#dulquer #rannvijay #ultraviolette #F77 #europelaunch #indiatotheworld
